const SignIn = () => {
    return (
        <div>
            <div >
            <style>{'body { background-color: lightpurple; }'}</style>
                <h1 >Hamachi</h1>
            </div>
            {/* <img src={companyLogo} width="200px"/> */}
            <div className="row">
                <div className="col">
                    <RegistrationForm />
                </div>
                <div className="col">
                    <LoginForm />
                </div>
            </div>

        </div>
    );
};


export default SignIn;
